pragma solidity ^0.8.19;

contract DocumentVerifier {
    event VerificationResult(address indexed user, bytes32 digest, bool verified);

    function verifySignature(
        bytes32 digest,
        bytes memory signature,
        address user
    ) public returns (bool) {
        require(user != address(0), "Invalid user address");
        
        bytes32 ethSignedMessageHash = getEthSignedMessageHash(digest);
        address recoveredSigner = recoverSigner(ethSignedMessageHash, signature);
        bool isValid = (recoveredSigner == user);
        
        emit VerificationResult(user, digest, isValid);
        return isValid;
    }

    function getEthSignedMessageHash(bytes32 _messageHash) internal pure returns (bytes32) {
        return keccak256(abi.encodePacked("\x19Ethereum Signed Message:\n32", _messageHash));
    }

    function recoverSigner(bytes32 _ethSignedMessageHash, bytes memory _signature)
        internal
        pure
        returns (address)
    {
        require(_signature.length == 65, "Invalid signature length");
        
        bytes32 r;
        bytes32 s;
        uint8 v;
        
        assembly {
            r := mload(add(_signature, 32))
            s := mload(add(_signature, 64))
            v := byte(0, mload(add(_signature, 96)))
        }
        
        if (v < 27) {
            v += 27;
        }
        
        require(v == 27 || v == 28, "Invalid signature version");
        
        return ecrecover(_ethSignedMessageHash, v, r, s);
    }
}
